import Navbar from "./Navbar";
import Head from 'next/head';

const Layout = (props) =>(
    <div>
        <Head>
            <title>NooBeeCamp</title>
            <link rel="stylesheet" href="https://stackpath.bootstrapcdn.com/bootstrap/4.5.0/css/bootstrap.min.css"/>
        </Head>
        <Navbar/>
        {props.children}
    </div>
)

export default Layout;
